import React from "react";
import './Slider.css';

const SliderAds = () =>{
    return (
        <div className="slider__ads">
            <div></div>
                <header className="slider__header">
                    <h1 className="header__text">Rabat 10% na pierwsze zamówienie!</h1>
                </header>
                <div className="slider__info">
                    <p className="info__text">Do 20 stycznia złóż zamówienie na stronie i skorzystaj z promocji -10%. Spiesz się, czas trwania promocji do końca lutego.</p>
                </div>
                <button className="slider__btn">Zamów online</button>

        </div>
    )

}

export default SliderAds;
